OBSERVACAO:
A Fundação de Ensino e Pesquisa em Ciências da Saúde (FEPECS), criada pela Lei nº 2.676, de 12 de janeiro de 2001146493419, é Fundação Pública com personalidade jurídica de Direito Público, de caráter científicotecnológico e educacional, sem fins lucrativos, vinculada diretamente à Secretaria de Saúde do Distrito Federal (SES-DF), conforme os princípios da Lei n° 9.394, de 20 de dezembro de 1996, que estabelece as diretrizes e bases da educação nacional;

Considerando a criação da Escola de Saúde Pública do Distrito Federal 147181904;
Considerando a finalidade da ESPDF 146493536 em conduzir, desenvolver e acompanhar os programas de residência, de forma descentralizada nas Regiões de Saúde, de interesse para o Sistema Único de Saúde do DF e região;

Considerando que os programas de residência em Ginecologia-Obstetrícia devem atender às normas impostas pelo MEC por meio das matrizes de competência 146493539;

Considerando que a não realização dos procedimentos de Histeroscopia, obrigatórios para os programas de residência de Ginecologia-Obstetrícia pode levar ao descredenciamento do programa pelo MEC, cuja gestão acadêmica está a cargo da FEPECS;

O presente processo tem por objetivo a compra de material de histeroscopia ginecológica para que os Residentes de Ginecologia-Obstetrícia possam realizar os procedimentos indicados na Matriz de Competências estabelecida pelo MEC sob a forma de Resolução CNRM nº, evitando assim, o descredenciamento dos programas de residência.

A aquisição de um vídeo-histeroscópio possibilitará a realização de procedimentos de histeroscopia em consultório, o qual auxiliará no tratamento de algumas patologias benignas da cavidade uterina. Esta cirurgia é realizada sem ser necessária uma incisão cirúrgica. A histeroscopia é um procedimento com relativa facilidade de execução, associado a um baixo risco de complicações e a uma morbidade mínima, sendo utilizada nos casos de patologia intra-uterina. As histeroscopias podem ser diagnósticas e cirúrgicas.
 As histeroscopias realizadas em consultório tem como indicação os pólipos endometriais de pequenas dimensões, os miomas submucosos pequenos, a exérese de sinéquias uterinas, a resseção de septos uterinos, a remoção de dispositivo intra-uterino (DIU) retido. A realização desses procedimentos em consultório acarretariam a diminuição do fluxo no centro cirúrgico asseguraria a integralidade da assistência e evitaria internações desnecessárias.

Na realização da histeroscopia ambulatorial, a mulher não necessita de anestesia geral e não é necessário estar em jejum, o que traz maior conforto e segurança a paciente, além de evitar a regulação para outros procedimentos.

 A aquisição do equipamento solicitado visa atender as necessidades de pacientes que necessitam de avaliação da cavidade uterina, ampliando o número de atendimentos e a celeridade no atendimento ao usuário.

 A aquisição desse aparelho garantirá a formação do médico residente de Ginecologia-Obstetrícia, conforme requerido pela Comissão Nacional de Residência Médica, evitando que os programas sejam descredenciados pelo MEC, pela falta de desenvolvimento das competências relacionadas ao procedimento.

 Riscos: A falta de realização dos procedimentos de Histeroscopia, obrigatórios para os programas de residência de Ginecologia-Obstetrícia pode levar ao descredenciamento do programa pelo MEC, cuja gestão acadêmica está a cargo da FEPECS.
